import Box from "@mui/material/Box";
import Tab from "@mui/material/Tab";
import Tabs from "@mui/material/Tabs";
import Typography from "@mui/material/Typography";
import PropTypes from "prop-types";
import * as React from "react";
import { Col, Row } from "react-bootstrap";
import Card from "react-bootstrap/Card";
import { Link } from "react-router-dom";
import "../Ecom/Ecom.css";
import Eomdocuments from "../Ecom/Ecom.json";

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`vertical-tabpanel-${index}`}
      aria-labelledby={`vertical-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box sx={{ p: 3 }}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.number.isRequired,
  value: PropTypes.number.isRequired,
};

function a11yProps(index) {
  return {
    id: `vertical-tab-${index}`,
    "aria-controls": `vertical-tabpanel-${index}`,
  };
}

export default function TechnologiesTab() {
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Box
      sx={{
        flexGrow: 1,
        bgcolor: "background.paper",
        display: "flex",
        height: 224,
      }}
    >
      <Tabs
        orientation="vertical"
        variant="scrollable"
        value={value}
        onChange={handleChange}
        aria-label="Vertical tabs example"
        sx={{ borderRight: 1, borderColor: "divider" }}
      >
        <Tab label="Vehicles" {...a11yProps(0)} />
        <Tab label="Loader" {...a11yProps(1)} />
        <Tab label="Medicine" {...a11yProps(2)} />
        <Tab label="Cultivator" {...a11yProps(3)} />
      </Tabs>
      <TabPanel value={value} index={0} className="tabPanel">
        <Row>
          <Col>
            <Row sm={12} md={6} lg={4} w={100} className="techItems">
              {Eomdocuments.filter(({ title, picture, des, id, category }) => {
                if ((category = "vehicle")) {
                  return (
                    <Card
                      className="Ecard"
                      // style={{ width: "15rem", height: "20rem" }}
                    >
                      <Link to="./EcomDetails">
                        <Card.Img
                          variant="top"
                          className="Eimages"
                          src={picture}
                        />
                        <Card.Body>
                          <Card.Text style={{ color: "gray" }}>{des}</Card.Text>
                          <Card.Title
                            style={{ color: "black", fontSize: "30px" }}
                          >
                            {title}
                          </Card.Title>
                        </Card.Body>
                      </Link>
                    </Card>
                  );
                }
              })}
            </Row>
          </Col>
        </Row>
      </TabPanel>
      <TabPanel value={value} index={1}>
        Item Two
      </TabPanel>
      <TabPanel value={value} index={2}>
        Item Three
      </TabPanel>
      <TabPanel value={value} index={3}>
        Item Four
      </TabPanel>
      <TabPanel value={value} index={4}>
        Item Five
      </TabPanel>
      <TabPanel value={value} index={5}>
        Item Six
      </TabPanel>
      <TabPanel value={value} index={6}>
        Item Seven
      </TabPanel>
    </Box>
  );
}
